import React, { Component } from "react";
import RecommendedNews from "./RecommendedNews";
import Navbar from "./Navbar";
import LatestNews from "./LatestNews";
import NewsByAuthor from "./NewsByAuthor";

class NewsFeed extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <h2 style={{ marginTop: "50px", marginLeft: "35px" }}>Latest NEWS</h2>
        <LatestNews />
        <h2 style={{ marginTop: "50px", marginLeft: "35px" }}>
          Recommended NEWS
        </h2>
        <RecommendedNews />
        <h2 style={{ marginTop: "50px", marginLeft: "35px" }}>Author NEWS</h2>
        <NewsByAuthor />
        <h2 style={{ marginTop: "50px", marginLeft: "35px" }}>Category NEWS</h2>
        <h2 style={{ marginTop: "50px", marginLeft: "35px" }}>Tag NEWS</h2>
        <h2 style={{ marginTop: "50px", marginLeft: "35px" }}>City NEWS</h2>
        <h2 style={{ marginTop: "50px", marginLeft: "35px" }}>Country NEWS</h2>
      </div>
    );
  }
}

export default NewsFeed;
